import React from 'react' ;
import './footer.css';
import { Container,Row,Col,ListGroup,ListGroupItem } from 'reactstrap';
import { Link } from 'react-router-dom';
import logo from '../../assets/images/logo.webp';

const quick__links=[
    {
        path:'/home',
        display:'Home'
    },
    {
        path:'/gallery',
        display:'Gallery'
    },
    {
        path:'/tours',
        display:'Tours'
    },
];

const quick__links2=[
    // {
    //     path:'/gallery',
    //     display:'Gallery'
    // },
    {
        path:'/login',
        display:'Login'
    },
    {
        path:'/register',
        display:'Register'
    },
]

const Footer = () => {
    const year=new Date().getFullYear();

    return (
        <footer className='footer'>
            <Container>
                <Row>
                    <Col lg='3'>
                        <img src={logo} className='size' alt="" />


                            <div className="social__links d-flex align-items-center gap-4">
                                <span>
                                    <Link to='#'>
                                        <i className='ri-youtube-line'/>
                                    </Link>
                                </span>

                                <span>
                                    <Link to='#'>
                                        <i className='ri-github-fill'/>
                                    </Link>
                                </span>

                                <span>
                                    <Link to='#'>
                                        <i className='ri-facebook-circle-line'/>
                                    </Link>
                                </span>

                                <span>
                                    <Link to='#'>
                                        <i classN='ri-instagram-line'/>
                                    </Link>
                                </span>
                            </div>
                    </Col>
                    <Col lg='3'>
                        <h5 className='footer__link-title'>Discover</h5>
                        <ListGroup className='footer__quick-links'>
                            {
                                quick__links.map((item,index)=>(
                                    <ListGroupItem key={index} className='ps-0 border-0'>
                                        <Link to={item.path}>{item.display}</Link>
                                    </ListGroupItem>
                                ))
                            }
                        </ListGroup>
                    </Col>

                    <Col lg='3'>
                        <h5 className='footer__link-title'>Discover</h5>
                        <ListGroup className='footer__quick-links'>
                            {
                                quick__links2.map((item,index)=>(
                                    <ListGroupItem key={index} className='ps-0 border-0'>
                                        <Link to={item.path}>{item.display}</Link>
                                    </ListGroupItem>
                                ))
                            }
                        </ListGroup>
                    </Col>

                    <Col lg='3'>
                        <h5 className='footer__link-title'>Contact</h5>
                        <ListGroup className='footer__quick-links'>
                            {
                                
                                    <ListGroupItem  className='ps-0 border-0 d-flex align-items-center gap-3'>
                                        <h6 className='mb-0 d-flex align-items-center gap-2'>
                                            <span><i class='ri-map-pin-line'/></span>
                                            Address:
                                        </h6>
                                        <p className='mb-0'>TamilNadu</p>                                        
                                    </ListGroupItem>
                            }
                            {
                                
                                <ListGroupItem  className='ps-0 border-0 d-flex align-items-center gap-3'>
                                    <h6 className='mb-0 d-flex align-items-center gap-2'>
                                        <span><i class='ri-mail-line'/></span>
                                        Email:
                                    </h6>
                                    <p className='mb-0'>tamilnadutourism@gmail.com</p>                                        
                                </ListGroupItem>
                        }
                        {
                                
                                <ListGroupItem  className='ps-0 border-0 d-flex align-items-center gap-3'>
                                    <h6 className='mb-0 d-flex align-items-center gap-2'>
                                        <span><i class='ri-phone-fill'/></span>
                                        Phone :
                                    </h6>
                                    <p className='mb-0'>+91 9876543210</p>                                        
                                </ListGroupItem>
                        }
                        </ListGroup>
                    </Col>

                   <Col lg='12' className='text-center pt-5 '>
                        <p className='copyright'>Copyright {year} , design and developed by Bharanidharan . All rights reserved.</p>
                    </Col> 

                    


                </Row>
            </Container>
        </footer>
    )
};

export default Footer;
